	<header 
		@mousedown="startDrag($event)"
		@touchmove="touchMove($event)"
		class="grab-header"
		ref="grab">
		Damage calculator
		<div class="reverse-info-box calculator-help">
			?
			<span class="info-box-text">Hold down "A" or "D" while clicking a unit to add it to the calculator</span>
		</div>
		<span class="close-calc">&#10005;</span>
	</header>
	<!-- Content is unloaded if calculator is not shown -->
	<div class="calc-content" v-if="toggled">
		<div class="headers">
			<header>Attacker
				<span
					class="select-attacker"
					ref="select-attacker"
					@click="selectUnit('attacker')">
					[Select]
				</span>
				<span 
					class="swap-position"
					@click="swapPosition()">
					[Swap]
				</span>
			</header>
			<header>Defender
				<span
					class="select-defender"
					ref="select-defender"
					@click="selectUnit('defender')">
					[Select]
				</span>
			</header>
		</div>
		<div class="calculator-main">
			<div class="calculator-attack">
				<div class="co-options">
					<div 
						class="co option"
						@click="toggleMenu('attacker', 'co')">
						<div class="selected-co">
							<img class="border" :src="'terrain/aw2/' + coTheme + attacker.co.co_name.toLowerCase() + '.png'">
						</div>
						<div class="co-menu" v-if="menuToggles.attacker.co"> 
							<img 
								v-for="co in cos"
								:src="'terrain/aw2/' + coTheme + co.co_name.toLowerCase() + '.png'"
								@click="attacker.co = co">
						</div>
					</div>
				</div>
				<div class="unit-options">
					<div
						class="unit option"
						@click="toggleMenu('attacker', 'unit')">
						<div class="selected-unit border">
							<img :src="terrainPath + attacker.country.code + attacker.unit.units_name.toLowerCase() + '.gif'">
							<img
								v-if="attacker.hp === '?' || (attacker.hp && attacker.hp > 0 && attacker.hp < 10)"
								:src="'terrain/aw2/' + attackerHpDisplay + '.gif'"
								class="hp-display">
						</div>
						<div class="unit-menu" v-if="menuToggles.attacker.unit">
							<img
								v-for="unit in units"
								:src="terrainPath + attacker.country.code + unit.units_name.toLowerCase() + '.gif'"
								@click="attacker.unit = unit">
						</div>
					</div>
					<div class="hp-options">
						<img src="terrain/hp.gif">
						<input 
							type="text"
							v-model="attacker.hp">
					</div>
				</div>
				<div class="terrain-options">
					<div
